import ReactDOM from 'react-dom'
import React from 'react'
import './index.css'
import Hamburger from './hamburger-menu.svg'


function NavbarHamburger() {
    return (
        <span><button class="hamburger"></button></span>
    )
}

function Navbar() {
    return (
        <header class="navbar-box navbar-position navbar-text">
            <div>
            <NavbarHamburger />
                <span id="header-text">Museum</span>
            </div>
        </header>
    )
}

function Test() {
    return (
        <div class="box">
            a Test
            <button>cool button</button>
        </div>
    )
}

function Manytests() {
    return (
        [
            <Navbar />
        ]
    )
}

ReactDOM.render(
    <Manytests />,
    document.getElementById('root')
);
